  false,\n\t\"url\": null,\n\t\"notes\": \"This status report summarizes background
  information on the habitat, biology, and ecology of the Dakota skipper (Hesperia
  dacotae) based on numerous publications, unpublished reports and observations, and
  an expert interview process. It also includes the best available information on
  the current distribution, population size and status of the species in Minnesota,
  North Dakota and South Dakota, based on recently completed field surveys. Part Two
  discusses conservation issues and management needs.\",\n\t\"license_title\": \"License
